import footerImg from "../Img/FooterPageFixed.png"
import styled from "styled-components"

export const Footer = () => {
  return (
    <div>
      <img src={footerImg} alt="monumentos" />
    </div>
    // <FooterPaises>
    // </FooterPaises>
  )
}

const FooterPaises = styled.div`
  background-image: url(${footerImg});
  background-size: cover;
  background-repeat: no-repeat;
  height: 30rem;
  width: 100%;  
`
